import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import 'bootstrap/dist/css/bootstrap.css';
import NavBar from './NavBar';
import Inputs from './Inputs';
import CustomDropzone from './CustomDropzone';

class UserUpload extends Component {
    render() {
        return (
            <Container fluid={true} style={{ paddingLeft: '0px' }}>
                <Row>
                    <Col md={4} style={{ backgroundColor: '#3830ab', height: '100vh' }}>
                        <NavBar></NavBar>
                        <div align='center'>
                            <h1 className='mb-0 pb-0' style={{ color: 'white', fontSize: '6vw' }}>UPLOAD</h1>
                        </div>
                    </Col>
                    <Col md={8}>
                        <Row style={{ height: '50vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                            <CustomDropzone />
                        </Row>
                        <Inputs />
                    </Col>
                </Row>
            </Container >
        )
    }
}

export default UserUpload;
